window.bookSummaryJSON = "<p><b>Ella Edwards is loving her dream life in the city of London, doing \"naughty\" things for a living and adoring every second.</b></p> <p>Her clients are getting naughtier, her paychecks are getting bigger, and she's dating another crazy hot 'entertainer' who's driving her wild.</p> <p>Josh, otherwise known as Weston—one of the greatest Agency Hardcorers of them all.</p> <p>The flames are burning bright, and the passion is scorching hot, so what could possibly go wrong?</p> <p>How about her betraying, cheater of an ex discovering what she does for a living, and throwing threats around that could bring her world tumbling down?</p> <p>Not everyone agrees with her career choices—and some of those people have a lot more influence than others…</p> <p>Will poor Ella get to keep climbing the naughty list, or will her Hardcorer dreams turn to dust?</p> <p><i>The follow-up to </i>The Naughty List! <i>No jingle bells or pre-listening necessary! </i>The Naughty List <i>was definitely naughty, so please heed the title of this one.</i></p>"; 
